import { Box, withStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  answers: any;
}

const Submit: React.FC<IProps> = ({ answers }) => {
  return (
    <>
      <Container>Submit</Container>
    </>
  );
};

export default Submit;

const Container = withStyles({
  root: {
    backgroundColor: "#209434",
    padding: "0.5rem 2rem",
    textAlign: "center",
    fontWeight: 500,
    fontSize: "1.5rem",
    margin: "0rem 5rem 5rem 5rem",
    borderRadius: 10,
    cursor: "pointer",
    "&:hover": {
      fontWeight: 900,
      backgroundColor: "green",
    },
  },
})(Box);
